import React from 'react';
import "./footer.css"

import logo from "../../assets/logo.png";
import { Phone } from '@mui/icons-material';
import GitHubIcon from '@mui/icons-material/GitHub';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailIcon from '@mui/icons-material/Email';

const Footer = () => {
    return (
        <div className='footer-container'>
            <hr />
            <div className='footer'>
                <div className='logo-f'>
                    <img src={logo} alt="" />
                </div>
                <div className='social-links'>
                    <GitHubIcon sx={{fontSize: "4rem",color:"white" ,"&:hover": { color: `var(--orange)` } }}/>
                    <InstagramIcon sx={{fontSize: "4rem",color:"white" ,"&:hover": { color: `var(--orange)` } }}/>
                    <LinkedInIcon sx={{fontSize: "4rem",color:"white" ,"&:hover": { color: `var(--orange)` } }}/>
                </div>
                <div>
                    <div>
                        <span>
                            <Phone sx={{fontSize: "2.7rem",color:"white"  }}/>
                        </span>
                        <span style={{color: "aliceblue", fontSize: "2rem", paddingLeft: "1.5rem"}}>06 10 10 47 28 </span>
                    </div>
                    <div>
                        <span>
                            <EmailIcon sx={{fontSize: "2.7rem",color:"white"  }}/>
                        </span>
                        <span style={{color: "aliceblue", fontSize: "2rem" ,paddingLeft: "1.5rem", marginBottom:"rem"}}>fit-club@gmail.com </span>
                    </div>
                </div>
            </div>
            <div className='blur blur-footer-1'></div>
            <div className='blur blur-footer-2'></div>
        </div>
    );
};

export default Footer;
